import React from "react";

import '../App.css';
import '../Styles/Clock.css';


function CountDown() {
  return (
    <div>
      <div className="clock">
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center"
          }}
        >
          <button type="button" style={{fontSize:45}}>+</button>
          <div className="hour">13</div>
        </div>
        <div className="colon">:</div>
        <div className="minute">55</div>
        <div className="colon">:</div>
        <div className="minute">20</div>
      </div>
    </div>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 4,
    backgroundColor: '#000',
    flexDirection:'row',
    alignItems: 'center',
    justifyContent: 'center',
  },
  timerContainer: {
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    opacity: 0.4,
  },
  buttonHoursText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#b1b2ff',
    fontSize: 50,
  },
  buttonMinuteText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#ffb3b3',
    fontSize: 50,
  },
  buttonSecondText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#ECA869',
    fontSize: 50,
  },
  timerhoursText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#b1b2ff',
    fontSize: 145,
  },
  timerminuteText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#ffb3b3',
    fontSize: 145,
  },
  timersecondText: {
    fontFamily: 'ConcertOne-Regular',
    color: '#ECA869',
    fontSize: 145,
  },
  colon: {
    fontFamily: 'ConcertOne-Regular',
    color: '#eef1ff',
    fontSize: 145,
    opacity: 0.4,
    marginBottom: 25,
  },
  startstopButton: {
    width: 150,
    height: 50,
    alignItems: 'center',
    justifyContent: 'center',
    paddingVertical: 12,
    paddingHorizontal: 16,
    borderRadius: 4,
    elevation: 3,
    backgroundColor: '#ECA869',
    opacity: 0.4,
  },
  startstopButtonText: {
    fontSize: 16,
    lineHeight: 21,
    fontWeight: 'bold',
    letterSpacing: 0.25,
    color: 'white',
  },

  homescreenButton: {
    width: 150,
    height: 50,
    alignItems: 'center',
    justifyContent: 'center',
    paddingVertical: 12,
    paddingHorizontal: 16,
    borderRadius: 4,
    elevation: 3,
    backgroundColor: '#b1b2ff',
    opacity: 0.4,
  },
  homescreenText: {
    fontSize: 16,
    lineHeight: 21,
    fontWeight: 'bold',
    letterSpacing: 0.25,
    color: 'white',
  },
});

export default CountDown;
